      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });
  };

  return (
    <>
      <h1 className='products'>PRODUCTS</h1>
      <Button onClick={apiCall}>Lets do an API call</Button>
    </>  
  );
}
